import { useEffect, useState } from "react";

const EURUSDrate = () => {
  const [eurusd, setEurusd] = useState({});

  const getData = async () => {
    const res = await fetch(
      "https://v6.exchangerate-api.com/v6/e309146a2616c35941e159ef/latest/EUR"
    );
    var data = await res.json();
    setEurusd(data.conversion_rates.USD)
  };

  useEffect(() => {
    getData().then(response => {setEurusd(response)})
    console.log(eurusd)
  }, []);


  return <div>EUR/USD</div>;
};

export default EURUSDrate;
